script: |
  super -f text -I q2334.spq | sort > q2334.out

inputs:
  - name: q2334.spq
    data: |
      SELECT DISTINCT col2 * + cor0.col0 + cor0.col0 + + 1 * ( + col2 * + col2 ) AS col2 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q2334.out
    data: |
      16976
      3081
      6961
